import React from 'react'
import Typography from '@mui/material/Typography';
import Item from './Item';
import styled from 'styled-components';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";



const Streamseparation = ({data,id,groupName}) => {
    console.log("item page--------------");
    console.log(`id:${id} group name:${groupName} length:${data.length}`);
    console.dir(data);

    const  Streamwrapper=styled.div`
        .item_container{
            
            justify-content:start;
            section{
                display:flex;
                flex:1 1 30%;

            }
        }

    `

    const Settings={
        dots:true,
        infinite:false,
        speed:500,
        slidesToShow:4,
        slidesToScroll:4,
        initialSlide:0
    }

    return (
    <Streamwrapper>
        <Typography variant="h3" className='mt-3'>{groupName}</Typography>
        <span>total no of student: {data.length}</span>
        <div className="item_container">
        <Slider {...Settings}>

        {
            data.map((val,idx)=>{
                return (
                        <Item key={idx} id={idx} data={val} />
                )
            })
        }
        </Slider>
        </div>


    </Streamwrapper>
  )
}

export default Streamseparation
